/** @format */

import React from "react";
import { Box, Card, CardContent, Typography } from "@mui/material";
import NumberFormat from "react-number-format";

const Cards = () => {
  return (
    <>
      <Box component="span" sx={{ display: "inline-block", mx: "1.5rem" }}>
        <Card sx={{ minWidth: 275 }}>
          <CardContent>
            <Typography
              sx={{ fontSize: 14 }}
              color="text.secondary"
              gutterBottom
            >
              Revenue In
            </Typography>
            <Typography variant="h3" component="h4">
              <NumberFormat
                value={23345}
                displayType={"text"}
                thousandSeparator={true}
              />
            </Typography>
          </CardContent>
        </Card>
        <Card sx={{ minWidth: 275 }}>
          <CardContent>
            <Typography
              sx={{ fontSize: 14 }}
              color="text.secondary"
              gutterBottom
            >
              Revenue out"
            </Typography>
            <Typography variant="h3" component="h4">
              <NumberFormat
                value={13345}
                displayType={"text"}
                thousandSeparator={true}
              />
            </Typography>
          </CardContent>
        </Card>
        <Card sx={{ minWidth: 275 }}>
          <CardContent>
            <Typography
              sx={{ fontSize: 14 }}
              color="text.secondary"
              gutterBottom
            >
              New Matters
            </Typography>
            <Typography variant="h3" component="h4">
              <NumberFormat
                value={3425}
                displayType={"text"}
                thousandSeparator={true}
              />
            </Typography>
          </CardContent>
        </Card>
      </Box>
    </>
  );
};

export default Cards;
